import React, { useState } from 'react';
import Navbar from '../NavBar'


function JournalDetial(props) {
  let [title, setTitle] = useState(props.currentJouranl.title)
  let [content, setContent] = useState(props.currentJouranl.content)
  const date = new Date(props.currentJouranl.created_at)

    return (
      <div >
        {Object.keys(props.loginUser).length > 0 
          ?<div div className="journal-page">
            <div className="journal-detail-header"></div>
          <Navbar />
          <div className="journal-sub-navbar">
                  <li onClick={() => this.handJournalClick()}><IoIosJournal style={{fontSize: '24px', marginRight: '5px', marginBottom: '3px'}} />Journal</li>
                  <li onClick={() => this.handDraftClick()}><RiDraftFill style={{fontSize: '24px', marginRight: '5px', marginBottom: '3px'}} />Draft({this.state.journalDrafts.length})</li>
              </div>
          <div>
          <h2>{title}</h2>
          <li>{date.toLocaleDateString()}</li>
          </div>
          <div className="detial"> 
                  <h2>{title}</h2>
                  <p>{content}</p>
                </div>
            </div>
            :props.history.push('/')    
          }
      </div>

    );
  }
  export default JournalDetial;
